} */

const App = () => {
  return (
    <section className="App">
      <BrowserRouter>
        <header className="App-header">
        <Header></Header>
        </header>
        <Switch>
                <Route path="/" component={Home} exact/>
                <Route path='/resume' component={Resume}/>
            </Switch>
      </BrowserRouter>
      <footer className="App-footer">
        <Footer></Footer>
      </footer>
    </section>
  )
}
export default App;
